#
# @lc app=leetcode id=15 lang=python3
#
# [15] 3Sum
#

# @lc code=start
class Solution:
    def threeSum(self, nums: list[int]) -> list[list[int]]:

        d = dict()
        for i in range(len(nums)):
            if nums[i] in d:
                d[nums[i]].append(i)
            else:
                d[nums[i]] = [i]

        res = set()
        ishow = set()
        for i in range(len(nums)):
            if nums[i] in ishow:
                continue
            else:
                ishow.add(nums[i])
            
            jshow = set()
            for j in range(i+1,len(nums)):
                if nums[j] in jshow:
                    continue
                else:
                    jshow.add(nums[j])

                kval = -(nums[i]+nums[j])
                if kval in d:
                    for id in d[kval]:
                        if id != i and id != j:
                            tup = [nums[i],nums[j],nums[id]]
                            tup.sort()
                            tup = tuple(tup)
                            if tup not in res:
                                res.add(tup)

        

        return list(map(list,res))

